namespace Celebros\Main\Block\System\Config\Form\Field;
use Magento\Framework\Data\Form\Element\AbstractElement;
use Magento\Framework\Setup\ModuleContextInterface;
class Extensions extends \Magento\Config\Block\System\Config\Form\Field
{
    const MODULE_NAME = 'Celebros_Main';
    protected $helper;
    
    public function __construct(
        \Celebros\Main\Helper\Data $helper,
        \Magento\Framework\App\CacheInterface $cache
    ) {
        $this->helper = $helper;
        $this->cache = $cache;
    }
    
    public function render(\Magento\Framework\Data\Form\Element\AbstractElement $element)
    {
        $html = '';
        $imgN = 'data:image/png;base64,';
        $imgI = 'data:image/png;base64,';
        $id = $element->getHtmlId();
        foreach ($this->getCelebrosModules() as $module) {
            $notification = '';
            $version = $this->cache->load($module['name'] . '_Last_Release');
            if ($version && $version > $module['setup_version']) {
                $notification = '<span style="color:green;"><img style="margin-left:15px;margin-right:5px;margin-bottom:-3px;" src="' . $imgN . '">' . $version . ' is available</span>';
            } elseif ($version && $version < $module['setup_version']) {
                $notification = '<span style="color:blue;"><img style="margin-left:15px;margin-right:5px;margin-bottom:-3px;" src="' . $imgI . '">' . $version . ' is last stable release</span>';
            }
            
            $html .= '<tr id="row_' . $id . '">';
            $html .= '<td class="label">' . str_replace("Celebros_", " ", $module['name']) . '</td><td class="value"><span style="width:60px;float:left;">' . $module['setup_version'] . '</span>' . $notification . '</td><td class="scope-label"></td>';
            $html .= '</tr>';
        }
        return $html;
    }

    public function getCelebrosModules()
    {
        return $this->helper->getCelebrosModules();       
    }
}